import React, { useState, useEffect } from "react";


const App = () => {
  const [posts, setPosts] = useState([]);

  useEffect(() => {
    const fetchPosts = () => {
      axios
        .get(
          "https://strangers-things.herokuapp.com/api/2105-SJS-RM-WEB-PT/posts/"
        )
        .then((response) => {
          console.log(response.data.data.posts);
          setPosts(response.data.data.posts);
        })
        .catch((error) => console.error("shit...", error));
    };
    fetchPosts();
  }, []);

  return (
    <div className="list">
      <h1>Posts</h1>
      {posts.map((post) => {
        return (
        <div className="some">
          <br/>
          <span>{post._id}</span>
          <br/>
          <span>{post.description}</span>
        </div>
        )
      })}
    </div>
  );
};
